// SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.0;

contract Winners {
    event Winner(address);

    function attempt() external {
        require(msg.sender != tx.origin, "msg.sender is equal to tx.origin");
        emit Winner(msg.sender);
    }
}

